<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Returning Function</title>
</head>
<body>
    <script>
        var u=[10,11,2003]
        function ud(z){
            return z;
        }
        var [D,M,Y]=ud(u)
        console.log(D);
        console.log(M);
        console.log(Y);
    </script>
</body>
</html>
